// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../node_modules/@openzeppelin/contracts/utils/Strings.sol";

contract MyNFT is ERC721Enumerable, Ownable {
    uint256 public result = 1;
    uint256 public mint_price = 0.1 ether;
    uint256 constant public MAX_TOKEN_COUNT = 100;

    constructor (string memory _name, string memory _symbol) ERC721(_name, _symbol) {
        contractCreator = msg.sender;
    }

    struct TokenData {
        uint Rank;
        uint256 Type;
    }

    mapping(uint256=> TokenData) public tokenDatas;
    address private contractCreator;

    function getCreator() public view returns (address payable) {
        return payable(contractCreator);
    }


    function _minting() public payable {
        require(msg.value >= mint_price);
        require(MAX_TOKEN_COUNT > ERC721Enumerable.totalSupply());

        uint256 tokenId = ERC721Enumerable.totalSupply() +1;

        TokenData memory data = getRandomNum(msg.sender, tokenId);
        tokenDatas[tokenId] = data;

        payable(Ownable.owner()).transfer(msg.value);
        _mint(msg.sender, tokenId); 
    }

    function tokenURI(uint _tokenId) public view override returns(string memory) {

        string memory Rank = Strings.toString(tokenDatas[_tokenId].Rank);
        string memory Type = Strings.toString(tokenDatas[_tokenId].Type);

        return string(abi.encodePacked("https://gateway.pinata.cloud/ipfs/QmPwjnvWYN4etA5eW4yAbWCTy2ukEC1Jj5417VLGyH5XpU/",
            Rank, "/", Type, ".json"
        ));
    }

    function getRandomNum(address _msgSender, uint256 _TokenId) private returns(TokenData memory) {

        uint256 randomNum = uint256(keccak256(abi.encodePacked(_msgSender, _TokenId)))%100;
        TokenData memory data;

        if (randomNum < 5) {
            if (randomNum == 1) {
                data.Rank = 4;
                data.Type = 1;
            } else if (randomNum == 2) {
                data.Rank = 4;
                data.Type = 2;
            } else if (randomNum == 3) {
                data.Rank = 4;
                data.Type = 3;
            } else {
                data.Rank = 4;
                data.Type = 4;
            }
        } else if (randomNum < 13) {
            if (randomNum < 7) {
                data.Rank = 3;
                data.Type = 1;
            } else if (randomNum < 9) {
                data.Rank = 3;
                data.Type = 2;
            } else if (randomNum < 11) {
                data.Rank = 3;
                data.Type = 3;
            } else {
                data.Rank = 3;
                data.Type = 4;
            }
        } else if (randomNum < 37) {
            if (randomNum < 19) {
                data.Rank = 2;
                data.Type = 1;
            } else if (randomNum < 25) {
                data.Rank = 2;
                data.Type = 2;
            } else if (randomNum < 31) {
                data.Rank = 2;
                data.Type = 3;
            } else {
                data.Rank = 2;
                data.Type = 4;
            }
        } else {
            if (randomNum < 52) {
                data.Rank = 1;
                data.Type = 1;
            } else if (randomNum < 68) {
                data.Rank = 1;
                data.Type = 2;
            } else if (randomNum < 84) {
                data.Rank = 1;
                data.Type = 3;
            } else {
                data.Rank = 1;
                data.Type = 4;
            }
        }

        return data;
    }
}
